import React from "react";

//Material UI
import { Typography, Grid } from "@material-ui/core";

const Footer = () => {
  return (
    <Grid container xs={12}>
      <Grid container xs={11}>
        <Grid item xs={11} md={3}></Grid>
        <Grid item xs={11} md={4}>
          Find Us
        </Grid>
        <Grid item xs={11} md={3}></Grid>
      </Grid>
    </Grid>
  );
};

export default Footer;
